@useless_dk - helping you increase your style confidence and do more with less.

I'm Signe, a former fashion designer turned certified stylecoach & colour consultant from Denmark. USE LESS is a personal styling service working within the field of slow fashion. Since 2015 I’ve helped my audience put on the right clothes, say goodbye to fast fashion and hello to lasting style that makes you glow from the inside and out. I embody a slow lifestyle where not being afraid of missing out but committing to the important things in life, is at the core of everything I do. On my YouTube channel I share style tips & tricks that are easy to implement and follow. 

For collaboration inquiries: collabs@uselesswardrobe.dk
